import Welcome from './components/Welcome'
import ClientReviews from './components/ClientReview'


function Home() {
  useEffect(() =>{
    document.title = "VIBO | Homepage";
  });

  const handleSearch = (values) => {
      console.log("Search form: ", values);
  }

  return (
    <div>
      <Header />
        <Searchbar
          onSubmit={handleSearch}
        />

      <Border />

      <Welcome />

      <Border />

      <ClientReviews />

      <Border />

      <Footer />
    </div>
  );
}

export default Home;
